"use strict";
import logo from './IMG_0004.PNG';
import './App.css';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import useSound from "use-sound";
import mySound from './A_resonant_trimmed_2.mp3'; 
import React from 'react';

function App (){

  const [play] = useSound(mySound);

  return (
    <div className="App"> 
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" onClick={useSound(mySound)}/>
        <a className = "Centering" href="https://raymondgifford.com">
          Centering
        </a>
      </header>
    </div>
  );

}

export default App;
